var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager,"Lead");
var id= esq.AddColumn("Id");
DateTime date = DateTime.Parse("12-01-2022");
var filterGroup = new EntitySchemaQueryFilterCollection(esq,LogicalOperationStrict.And);
filterGroup.Add(esq.CreateFilterWithParameters(FilterComparisonType.Greater,"ModifiedOn",date));
esq.Filters.Add(filterGroup);
var entityCollection = esq.GetEntityCollection(UserConnection);
List<Guid> list=new List<Guid>();
if(entityCollection != null)
{
	foreach(var entity in entityCollection)
	{

		list.Add(entity.GetTypedColumnValue<Guid>(id.Name));
	}
	Set("LeadList",JsonConvert.SerializeObject(list));
}
else
{
	Set("LeadList","");
}
return true;

var data = Get<string>("LeadList");
var ListOfLeads = JsonConvert.DeserializeObject<List<Guid>>(data);
if(ListOfLeads.Count()<1)
{
	Set("Continue",false);
	return true;

}
else{
	var leadDetails = ListOfLeads.First();
	if(!string.IsNullOrEmpty(leadDetails.ToString()))
	{
	Set("LeadId",leadDetails);
	ListOfLeads.RemoveAt(0);
	Set("LeadList",JsonConvert.SerializeObject(ListOfLeads));

	}
	else
	{
		ListOfLeads.RemoveAt(0);
		Set("LeadList",JsonConvert.SerializeObject(ListOfLeads));
	}
	Set("Continue",true);

}


return true;

